class Solution:
    def minKBitFlips(self, A: 'List[int]', K: 'int') -> 'int':
        i = 0
        n = len(A)
        print(n)
        res = 0
        while i < n:
            if A[i] == 0:
                if i + K > n:
                    return -1
                for j in range(i, i + K):
                    A[j] ^= 1
                res += 1
            while i < n and A[i] == 1:
                i += 1
        return res

    def minKBitFlips1(self, A: 'List[int]', K: 'int') -> 'int':
        n = len(A)
        res = 0
        for i in range(n):
            if A[i] == 0:
                if i + K > n:
                    return -1
                for j in range(i, i + K):
                    A[j] = 1 - A[j]
                res += 1
        return res
    def minKBitFlips2(self, A: 'List[int]', K: 'int') -> 'int':
        cur = res = 0
        for i in range(len(A)):
            if i >= K and A[i - K] == 2:
                cur -= 1
            if (cur % 2) == A[i]:
                if i + K > len(A):
                    return -1
                A[i] = 2
                cur, res = cur + 1, res + 1
        return res




